import {
  Box,
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  Text,
  Image,
} from '@chakra-ui/react';

const Dashboard = () => {
  return (
    <Box
      bgColor="white"
      w="100%"
      display="flex"
      h="auto"
      padding="32px"
      gap="24px"
    >
      <Box bgColor="blue.50" w="100%" height="auto" padding='16px' gap='8px' borderRadius='8px'>
        <Box>
        <Image src={window.location.origin + '/bx-group.png'} width='40px' height='40px' />
        <Text fontSize='14px' fontWeight='bold' color='blue.800' >Student</Text>
        </Box>
        <Box>
          <Text fontSize='14px' fontWeight='bold' color='blue.800' textAlign='right'>243</Text>
        </Box>
      </Box>
    </Box>
  );
};

export default Dashboard;
